Так мы вызвали на дом кардиолога. Он долго слушал сердце и в итоге сделал УЗИ сердца, потому что проблема была не в сердце.
После его визита были следующие гипотезы:
- коллапс трахеи;
- астма; 
- аллергия;
- сердечные гельминты.
Плюс оказалось, что рентген был плохо сделан

Что мы имеем сейчас?
Кашель до сих пор есть, но он не мешает ей жить.
Он возникает по нескольким причинам:
- если Коха перепугалась, например, залезла на стол, хотя ей туда нельзя, и ей застукали за этим делом;
- когда накапливается шерсть перед срыгиванием;

Коха практически всегда бежит встречать своего человека. Исключения: 
- если человек уходил и возвращался несколько раз, то скорее всего, на третий не выйдет;
- если возвращаешься после 10 вечера;
- и если попадаешь в глубокий сон Кохи)
